import React, { Component, useState } from "react";
import { Link } from "react-router-dom";

class Nav extends Component {
  render() {
    const [toggle] = useState("false");

    return (
      <nav>
        <ul>
          <div></div>
          <Link to="/animation">
            <li>Animation</li>
          </Link>
          <Link to="/film">
            <li>Film</li>
          </Link>
          <Link to="/about">
            <li>About</li>
          </Link>
        </ul>
      </nav>
    );
  }
}

export default Nav;
